, 2017, 2021))) {\n","        url <- paste0(\"https://en.wikipedia.org/wiki/Billboard_Year-End_Hot_100_singles_of_\",\n","                  as.character(yr))\n","        df <- read_html(url) %>% html_table(fill = TRUE)\n","        df <- df[[1]] %>% rename(Rank = \"No.\",\n","                                 Artist = \"Artist(s)\",\n","                                 Song = \"Title\")\n","        df$Song <- gsub('\"', '', df$Song)\n","        df <- df[, c(1, 3, 2)]\n","    }\n","    message(paste(\"Success fetching billboard table for year\", yr))\n","    return(df)\n","  },\n","  error = function(cond) {\n","    message(paste(\"Error fetching billboard table for year\", yr))\n","  })\n","}"]},{"cell_type":"code","execution_count":6,"id":"bec90040","metadata":{"execution":{"iopub.execute_input":"2022-02-28T13:55:22.565565Z","iopub.status.busy":"2022-02-28T13:55:22.563267Z","iopub.status.idle":"2022-02-28T13:55:26.859619Z","shell.execute_reply":"2022-02-28T13:55:26.858109Z"},"papermill":{"duration":4.584299,"end_time":"2022-02-28T13:55:26.859839","exception":false,"start_time":"2022-02-28T13:55:22.27554","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Success fetching billboard table for year 2015\n","\n","Success fetching billboard table for year 2016\n","\n"]}],"source":["ldf <- lapply(yr.ls, yr.to.df)\n","names(ldf) <- yr.ls"]},{"cell_type":"markdown","id":"25bf3321","metadata":{"papermill":{"duration":0.289717,"end_time":"2022-02-28T13:55:27.444983","exception":false,"start_time":"2022-02-28T13:55:27.155266","status":"completed"},"tags":[]},"source":["# Get song lyrics"]},{"cell_type":"markdown","id":"e113889b","metadata":{"papermill":{"duration":0.293001,"end_time":"2022-02-28T13:55:28.02767","exception":false,"start_time":"2022-02-28T13:55:27.734669","status":"completed"},"tags":[]},"source":["Define function to get lyrics of a song:"]},{"cell_type":"code","execution_count":7,"id":"c9ce26ff","metadata":{"execution":{