    lyrics <- gsub(\"ðŸ‡®ðŸ‡¹ Made with love.*\", \"\", lyrics)\n","    if (length(lyrics) == 0) {\n","      lyrics <- NULL\n","    }\n","    return(lyrics)\n","  },\n","  error = function(cond) {\n","    message(paste(\n","      \"Error fetching lyrics for url \",\n","      url,\n","      \"artist:\",\n","      x[2],\n","      \"song:\",\n","      x[3]\n","    ))\n","  })\n","}"]},{"cell_type":"markdown","id":"a03de4d3","metadata":{"papermill":{"duration":0.286466,"end_time":"2022-02-28T13:55:29.19168","exception":false,"start_time":"2022-02-28T13:55:28.905214","status":"completed"},"tags":[]},"source":["Get lyrics of all songs:"]},{"cell_type":"code","execution_count":8,"id":"759db82d","metadata":{"execution":{"iopub.execute_input":"2022-02-28T13:55:29.769556Z","iopub.status.busy":"2022-02-28T13:55:29.767701Z","iopub.status.idle":"2022-02-28T13:55:29.782512Z","shell.execute_reply":"2022-02-28T13:55:29.781045Z"},"papermill":{"duration":0.30595,"end_time":"2022-02-28T13:55:29.782671","exception":false,"start_time":"2022-02-28T13:55:29.476721","status":"completed"},"tags":[]},"outputs":[],"source":["get.df.lyrics = function(i) {\n","  tryCatch({\n","    lyrics <- apply(ldf[[i]], 1, get.lyrics, yr = yr.ls[i])\n","    ldf[[i]]$lyrics <- lyrics\n","    Sys.sleep(runif(1, 100, 120))\n","    message(paste(\"Finished fetching lyrics for year \", names(ldf)[[i]]))\n","    return(ldf[[i]])\n","  },\n","  error = function(cond) {\n","    message(paste(\"Error fetching lyrics for year \", names(ldf)[[i]]))\n","  })\n","}"]},{"cell_type":"code","execution_count":9,"id":"61319a23","metadata":{"execution":{"iopub.execute_input":"2022-02-28T13:55:30.366175Z","iopub.status.busy":"2022-02-28T13:55:30.364353Z","iopub.status.idle":"2022-02-28T14:00:54.05501Z","shell.execute_reply":"2022-02-28T14:00:54.055633Z"},"papermill":{"duration":323.983146,"end_time":"2022-02-28T14:00:54.055816","exception":false,"start_time":"2022-02-28T13:55:30.07267","status":"completed"},"tags":[]},"outputs"